import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <nav>
      <ul display={inline - block}>
        <li>World</li>
        <li>Politics</li>
        <li>US</li>
        <li>Business</li>
        <li>Opinion</li>
        <li>Health</li>
        <li>Entertainment</li>
      </ul>
    </nav>
  );
}

export default App;
